@import '_mediaQueries';
* {
    margin: 0;
    padding: 0;
    box-sizing: border-box;
}

html {
    background-color: #fff;
    color: #555;
    font-family: 'Dosis', sans-serif;
    font-size: 20px;
    text-rendering: optimizeLegibility;
    @include responsive (tab-landscape) {
        font-size: 80%;
    }
    @include responsive (tab-port) {
        font-size: 80%;
    }
    @include responsive (tab-landscape) {
        font-size: 80%;
    }
    @include responsive (tab-landscape) {
        font-size: 80%;
    }
}

// VARIABLES
@mixin flex-container($dir) {
    display: flex;
    flex-direction: $dir;
    box-shadow: 2px 15px 20px 0px #bbbbbb59;
}

@mixin column($width, $shadow1) {
    width: $width;
    float: left;
    font-family: 'Dosis', sans-serif;
}

@mixin button($width) {
    display: inline-block;
    margin-bottom: 0;
    font-weight: 300;
    text-align: center;
    white-space: nowrap;
    vertical-align: middle;
    -ms-touch-action: manipulation;
    touch-action: manipulation;
    cursor: pointer;
    background-image: none;
    border: 1px solid transparent;
    padding: 6px 12px;
    font-size: 14px;
    border-radius: 0;
    line-height: 1.42857143;
    -webkit-user-select: none;
    -moz-user-select: none;
    -ms-user-select: none;
    user-select: none;
    background-color: #b1086d;
    color: #fff;
    font-family: 'Dosis', sans-serif;
    width: $width;
}

@mixin sidebar-menu($heighth, $width) {
    height: $heighth;
    width: $width;
    top: 0;
    left: 0;
    background-color: #b4b1b173;
    overflow-x: hidden;
    position: sticky;
    background: #ccc;
}

// Wrapper
.wrapper {
    width: 100%;
    max-width: 1280px;
    margin: 0 auto;
}

.flex-container {
    display: flex;
}

.box {
    height: 300px;
    min-width: 300px;
    flex-grow: 2.5;
}

.one {
    height: 300px;
    min-width: 300px;
    -webkit-box-flex: 1;
    -ms-flex-positive: 1;
    flex-grow: 1;
    flex-direction: column;
    display: flex;
    flex-wrap: wrap;
    align-content: center;
    justify-content: flex-start;
}

.three {
