.carousel {
    margin: 7% 7% 0 7%;
}

.flex-container {
    @include flex-container(row);
}

// Image Carousel Elements
.slideshow-container {
    max-width: 1000px;
    position: relative;
    margin: auto;
}

slideimages {
    img {
        vertical-align: middle;
    }
}

.text {
    color: #252222;
    font-size: 15px;
    padding: 8px 12px;
    position: absolute;
    bottom: 8px;
    width: 100%;
    text-align: center;
}

// Previous and next buttons for the carousel
.prev,
.next {
    cursor: pointer;
    position: absolute;
    top: 50%;
    width: auto;
    padding: 16px;
    margin-top: -22px;
    color: white;
    font-weight: bold;
    font-size: 18px;
    transition: 0.6s ease;
    border-radius: 0 3px 3px 0;
    user-select: none;
}
/* Position the "next button" to the right */

.next {
    right: 0;
    border-radius: 3px 0 0 3px;
}
/* On hover, add a black background color with a little bit see-through */

.prev:hover,
.next:hover {
    background-color: rgba(0, 0, 0, 0.8);
}

//  The dots/bullets/indicators 
.dot {
    cursor: pointer;
    height: 4px;
    width: 4px;
    margin: 0 4px;
    background-color: #000;
    border-radius: 50%;
    display: inline-block;
    transition: background-color 0.6s ease;
}

.active,
.dot:hover {
    background-color: #fff;
}
/* Clear floats after the columns */

h5 {
    font-family: 'Dosis', sans-serif;
}

.row:after {
    content: "";
